import MyButton from "../../UI/MyButton/MyButton"


const EventsFrom = () =>
{
    const TravelTo = () =>
    {
        window.location.href = "http://localhost:3000/events"
    }
    return (
        <div>
            <MyButton onClick = {TravelTo}>События</MyButton>
            <p>На данной вкладке вы можете ознакомится со списком \nосновных событий</p>
        </div>
    )
}

export default EventsFrom;
